import React from 'react'
import Todo from './Todo'

export default function TodoList(props) {
  return (
    <>
    <div>
      <h1>To-Do List</h1>

    props.todos.map((todo) => {
       <Todo todo={Todo} />
    })

    </div>
    </>
  )
}
